window.bookSummaryJSON = "<p><b>Transformation, enchantment, and the emotional truths of family history teem in Kathleen Jennings’ stunning debut, </b><b><i>Flyaway</i></b><b>. </b></p> <p>\"Kathleen Jennings' prose dazzles, and her magic feels real enough that you might even prick your finger on it.\" (Kelly Link)</p> <p>\"Half mystery, half fairy tale, all exquisitely rendered and full of teeth.” (Holly Black)</p> <p>In a small Western Queensland town, a reserved young woman receives a note from one of her vanished brothers - a note that makes her question her memories of their disappearance and her father’s departure. </p> <p>A beguiling story that proves that Gothic delights and uncanny family horror can live - and even thrive - under a burning sun, <i>Flyaway </i>introduces listeners to Bettina Scott, whose search for the truth throws her into tales of eerie dogs, vanished schools, cursed monsters, and enchanted bottles. <i>Flyaway </i>enchants you with the sly, beautiful darkness of Karen Russell and a world utterly its own.</p> <p><b>A Macmillan Audio production from Tor.com </b></p>"; 
